import React from "react";
import Metal from "../Components/portfolio/Metal";
import PageHeader from "../Components/common/PageHeader";
import Spacer from "../Components/common/Spacer3";

function MetalPage() {
  return (
    <>
      <Spacer />
      <PageHeader title="Özel Üretim Burçlar" />
      <Metal />
    </>
  );
}

export default MetalPage;
